import React from 'react';
import './Home.css';
const Home = () => {
	return (
       <>
      <div className="home1">
        <img src="/components/homebg.jpeg" alt="" />
        <center><img className="home-logo" src="./Images/nitsmun.png" alt="NITSMUN's logo" /></center>
      </div>
        
       </>
       )
}
export default Home
